ft10445391.encodeClickCount = 1;

ft10445391.addVClick = function(ct) {
    var o = this;
    if (ct.indexOf("http://") > -1) {
        //account for when someone uses http in clicktag1
        ct = ct.replace(/http:\/\//g, "https://");
    }
    //insert presuffix below between quotes
    var preSuffix = "?CMP=PMC-CRT|",
    dcmCustom = (window['ftCustom_' + o.pID]).split('_'),
    newFtCustom = [];

    newFtCustom.push(dcmCustom[0], dcmCustom[2], dcmCustom[3], o.creativeID, o.confID,"&IMPID="+o.ftImpId);
    dcmCustom = newFtCustom.join("|");
    ct = ct.replace("\u0000=!;", "UNDEFINED");
    var suffix = preSuffix + dcmCustom;
    var pubClick = o.decode(o.qs('click', ''));
    var encodeCount = o.encodeClickCount;
    ct = ct + suffix;
/*
      Neustar Issue start
    */
    if (ct.indexOf("agkn") > -1) {
      var escapeMod = pubClick ? "2" : "1";

      if (o.flashVar && escapeMod) {
          o.flashVar("ftEscapeMod", escapeMod);
      }
      var ctSplit = ct.split("https"), ctBuild = "", neustarHolder = "";
      for (var i = 0; i < ctSplit.length; i++) {
          if(ctSplit[i].indexOf("agkn") > -1){
              neustarHolder = o.replaceMacros(ctSplit[i], true);
              ctSplit.splice(i,1);
          }

          if(ctSplit[i].length > 0){
              ctBuild += "https" + ctSplit[i];
          }   
      }
      ct = "https" + neustarHolder + encodeURIComponent(ctBuild);
    }
    /*
      Neustar Issue end
    */
    if (encodeCount && pubClick) {
        while (encodeCount--) {
            ct = encodeURIComponent(ct);
        }
    } else if (pubClick && o.inApp) {
        if (/^mopubnativebrowser:\/\//.test(pubClick)) {
            ct = encodeURIComponent(encodeURIComponent(ct));
        } else {
            ct = encodeURIComponent(ct);
        }
    }
    return pubClick + ct;
};
